import React from 'react';
import { Carousel } from 'react-bootstrap';

const AboutSlides = () => {
  return (
    <Carousel>
      <Carousel.Item>
        <h3>Our Story</h3>
        <p> We started LinkedRoad with the vision of creating a platform that connects businesses with the right talent. Our passion for helping companies find the best employees and job seekers to find the perfect job is what drives us.</p>
      </Carousel.Item>
      <Carousel.Item>
        <h3>Our Mission</h3>
        <p>Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris.</p>
      </Carousel.Item>
      <Carousel.Item>
        <h3>Slide 3</h3>
        <p>Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.</p>
      </Carousel.Item>
    </Carousel>
  );
};

export default AboutSlides;
